package dev.sugaroflead;

import static org.junit.Assert.assertEquals;

import org.junit.Test;

public class SolutionTest {
    
    @Test
    public void testPermutationCount1() {
        Solution s = new Solution();
        long res = s.getPermutationsCount(1);
        assertEquals(1, res);
    }

    @Test
    public void testPermutationCount2() {
        Solution s = new Solution();
        long res = s.getPermutationsCount(2);
        assertEquals(3, res);
    }

    @Test
    public void testPermutationCount3() {
        Solution s = new Solution();
        long res = s.getPermutationsCount(3);
        assertEquals(6, res);
    }

    @Test
    public void testPermutationCount4() {
        Solution s = new Solution();
        long res = s.getPermutationsCount(4);
        assertEquals(10, res);
    }

    @Test
    public void testPermutationCount5() {
        Solution s = new Solution();
        long res = s.getPermutationsCount(5);
        assertEquals(15, res);
    }

    @Test
    public void testCase1() {
        Solution s = new Solution();
        int val = s.countHomogenous("abbcccaa");
        assertEquals(13, val);
    }

    @Test
    public void testCase2() {
        Solution s = new Solution();
        int val = s.countHomogenous("xy");
        assertEquals(2, val);
    }

    @Test
    public void testCase3() {
        Solution s = new Solution();
        int val = s.countHomogenous("zzzzz");
        assertEquals(15, val);
    }

    @Test
    public void testCase4() {
        Solution s = new Solution();
        int val = s.countHomogenous("");
        assertEquals(49965, val);
    }
}
